import ExpenseItem from "./ExpenseItem";
import './Expenses.css'

function Expenses(props) {
    return (
        <div className="expenses">
            <ExpenseItem
                title={props.exp1.title}
                amount={props.exp1.amount}
                date={props.exp1.date}
            ></ExpenseItem>
            <ExpenseItem
                title={props.exp2.title}
                amount={props.exp2.amount}
                date={props.exp2.date}
            ></ExpenseItem>
            <ExpenseItem
                title={props.exp3.title}
                amount={props.exp3.amount}
                date={props.exp3.date}
            ></ExpenseItem>
        </div>

      )
}

export default Expenses
